import React from "react";
import { Button } from '@material-ui/core';


function CreateNewJokeBtn(props) {
  return (
    <Button 
        onClick={props.handleFormSubmitCreateJokeUser} 
        className="btn btn-primary">
        New Joke
    </Button>
  );
}

export default CreateNewJokeBtn;
